		"\r\n" + 
		"uint8_t SoftSPI::transfer(uint8_t val) {\r\n" + 
		"    uint8_t out = 0;\r\n" + 
		"    if (_order == MSBFIRST) {\r\n" + 
		"        uint8_t v2 = \r\n" + 
		"            ((val & 0x01) << 7) |\r\n" + 
		"            ((val & 0x02) << 5) |\r\n" + 
		"            ((val & 0x04) << 3) |\r\n" + 
		"            ((val & 0x08) << 1) |\r\n" + 
		"            ((val & 0x10) >> 1) |\r\n" + 
		"            ((val & 0x20) >> 3) |\r\n" + 
		"            ((val & 0x40) >> 5) |\r\n" + 
		"            ((val & 0x80) >> 7);\r\n" + 
		"        val = v2;\r\n" + 
		"    }\r\n" + 
		"\r\n" + 
		"    uint8_t del = _delay >> 1;\r\n" + 
		"\r\n" + 
		"    uint8_t bval = 0;\r\n" + 
		"    /*\r\n" + 
		"     * CPOL := 0, CPHA := 0 => INIT = 0, PRE = Z|0, MID = 1, POST =  0\r\n" + 
		"     * CPOL := 1, CPHA := 0 => INIT = 1, PRE = Z|1, MID = 0, POST =  1\r\n" + 
		"     * CPOL := 0, CPHA := 1 => INIT = 0, PRE =  1 , MID = 0, POST = Z|0\r\n" + 
		"     * CPOL := 1, CPHA := 1 => INIT = 1, PRE =  0 , MID = 1, POST = Z|1\r\n" + 
		"     */\r\n" + 
		"\r\n" + 
		"    int sck = (_ckp) ? HIGH : LOW;\r\n" + 
		"\r\n" + 
		"    for (uint8_t bit = 0u; bit < 8u; bit++)\r\n" + 
		"    {\r\n" + 
		"        if (_cke) {\r\n" + 
		"            sck ^= 1;\r\n" + 
		"            digitalWrite(_sck, sck);            \r\n" + 
		"            wait(del);\r\n" + 
		"        }\r\n" + 
		"\r\n" + 
		"        /* ... Write bit */\r\n" + 
		"        digitalWrite(_mosi, ((val & (1<<bit)) ? HIGH : LOW));\r\n" + 
		"\r\n" + 
		"        wait(del);\r\n" + 
		"\r\n" + 
		"        sck ^= 1u; digitalWrite(_sck, sck);\r\n" + 
		"\r\n" + 
		"        /* ... Read bit */\r\n" + 
		"        {\r\n" + 
		"            bval = digitalRead(_miso);\r\n" + 
		"\r\n" + 
		"            if (_order == MSBFIRST) {\r\n" + 
		"                out <<= 1;\r\n" + 
		"                out |= bval;\r\n" + 
		"            } else {\r\n" + 
		"                out >>= 1;\r\n" + 
		"                out |= bval << 7;\r\n" + 
		"            }\r\n" + 
		"        }\r\n" + 
		"\r\n" + 
		"        wait(del);\r\n" + 
		"\r\n" + 
		"        if (!_cke) {\r\n" + 
		"            sck ^= 1u;\r\n" + 
		"            digitalWrite(_sck, sck);\r\n" + 
		"        }\r\n" + 
		"    }\r\n" + 
		"\r\n" + 
		"    return out;\r\n" + 
		"}\r\n" + 
		"\r\n" + 
		"uint16_t SoftSPI::transfer16(uint16_t data)\r\n" + 
		"{\r\n" + 
		"	union {\r\n" + 
		"		uint16_t val;\r\n" + 
		"		struct {\r\n" + 
		"			uint8_t lsb;\r\n" + 
		"			uint8_t msb;\r\n" + 
		"		};\r\n" + 
		"	} in, out;\r\n" + 
		"  \r\n" + 
		"	in.val = data;\r\n" + 
		"\r\n" + 
		"	if ( _order == MSBFIRST ) {\r\n" + 
		"		out.msb = transfer(in.msb);\r\n" + 
		"		out.lsb = transfer(in.lsb);\r\n" + 
		"	} else {\r\n" + 
		"		out.lsb = transfer(in.lsb);\r\n" + 
		"		out.msb = transfer(in.msb);\r\n" + 
		"	}\r\n" + 
		"\r\n" + 
		"	return out.val;\r\n" + 
		"}\r\n" + 
		"";
