public static String string4="LZ77 and LZ78\r\n" + 
		"From Wikipedia, the free encyclopedia\r\n" + 
		"Jump to navigation\r\n" + 
		"Jump to search\r\n" + 
		"\r\n" + 
		"LZ77 and LZ78 are the two lossless data compression algorithms published in papers by Abraham Lempel and Jacob Ziv in 1977[1] and 1978.[2] They are also known as LZ1 and LZ2 respectively.[3] These two algorithms form the basis for many variations including LZW, LZSS, LZMA and others. Besides their academic influence, these algorithms formed the basis of several ubiquitous compression schemes, including GIF and the DEFLATE algorithm used in PNG and ZIP.\r\n" + 
		"\r\n" + 
		"They are both theoretically dictionary coders. LZ77 maintains a sliding window during compression. This was later shown to be equivalent to the explicit dictionary constructed by LZ78?ver, they are only equivalent when the entire data is intended to be decompressed.\r\n" + 
		"\r\n" + 
		"Since LZ77 encodes and decodes from a sliding window over previously seen characters, decompression must always start at the beginning of the input. Conceptually, LZ78 decompression could allow random access to the input if the entire dictionary were known in advance. However, in practice the dictionary is created during encoding and decoding by creating a new phrase whenever a token is output.[4]\r\n" + 
		"\r\n" + 
		"The algorithms were named an IEEE Milestone in 2004.[5]\r\n" + 
		"Contents\r\n" + 
		"\r\n" + 
		"    1 Theoretical efficiency\r\n" + 
		"    2 LZ77\r\n" + 
		"        2.1 Pseudocode\r\n" + 
		"        2.2 Implementations\r\n" + 
		"    3 LZ78\r\n" + 
		"    4 See also\r\n" + 
		"    5 References\r\n" + 
		"    6 External links\r\n" + 
		"\r\n" + 
		"Theoretical efficiency\r\n" + 
		"\r\n" + 
		"In the second of the two papers that introduced these algorithms they are analyzed as encoders defined by finite-state machines. A measure analogous to information entropy is developed for individual sequences (as opposed to probabilistic ensembles). This measure gives a bound on the data compression ratio that can be achieved. It is then shown that there exist finite lossless encoders for every sequence that achieve this bound as the length of the sequence grows to infinity. In this sense an algorithm based on this scheme produces asymptotically optimal encodings. This result can be proven more directly, as for example in notes by Peter Shor.[6]\r\n" + 
		"LZ77\r\n" + 
		"\r\n" + 
		"LZ77 algorithms achieve compression by replacing repeated occurrences of data with references to a single copy of that data existing earlier in the uncompressed data stream. A match is encoded by a pair of numbers called a length-distance pair, which is equivalent to the statement \"each of the next length characters is equal to the characters exactly distance characters behind it in the uncompressed stream\". (The distance is sometimes called the offset instead.)\r\n" + 
		"\r\n" + 
		"To spot matches, the encoder must keep track of some amount of the most recent data, such as the last 2 kB, 4 kB, or 32 kB. The structure in which this data is held is called a sliding window, which is why LZ77 is sometimes called sliding-window compression. The encoder needs to keep this data to look for matches, and the decoder needs to keep this data to interpret the matches the encoder refers to. The larger the sliding window is, the longer back the encoder may search for creating references.\r\n" + 
		"\r\n" + 
		"It is not only acceptable but frequently useful to allow length-distance pairs to specify a length that actually exceeds the distance. As a copy command, this is puzzling: \"Go back four characters and copy ten characters from that position into the current position\". How can ten characters be copied over when only four of them are actually in the buffer? Tackling one byte at a time, there is no problem serving this request, because as a byte is copied over, it may be fed again as input to the copy command. When the copy-from position makes it to the initial destination position, it is consequently fed data that was pasted from the beginning of the copy-from position. The operation is thus equivalent to the statement \"copy the data you were given and repetitively paste it until it fits\". As this type of pair repeats a single copy of data multiple times, it can be used to incorporate a flexible and easy form of run-length encoding.\r\n" + 
		"\r\n" + 
		"Another way to see things is as follows: While encoding, for the search pointer to continue finding matched pairs past the end of the search window, all characters from the first match at offset D and forward to the end of the search window must have matched input, and these are the (previously seen) characters that comprise a single run unit of length LR, which must equal D. Then as the search pointer proceeds past the search window and forward, as far as the run pattern repeats in the input, the search and input pointers will be in sync and match characters until the run pattern is interrupted. Then L characters have been matched in total, L > D, and the code is [D, L, c].\r\n" + 
		"\r\n" + 
		"Upon decoding [D, L, c], again, D = LR. When the first LR characters are read to the output, this corresponds to a single run unit appended to the output buffer. At this point, the read pointer could be thought of as only needing to return int(L/LR) + (1 if L mod LR ? 0) times to the start of that single buffered run unit, read LR characters (or maybe fewer on the last return), and repeat until a total of L characters are read. But mirroring the encoding process, since the pattern is repetitive, the read pointer need only trail in sync with the write pointer by a fixed distance equal to the run length LR until L characters have been copied to output in total.\r\n" + 
		"\r\n" + 
		"Considering the above, especially if the compression of data runs is expected to predominate, the window search should begin at the end of the window and proceed backwards, since run patterns, if they exist, will be found first and allow the search to terminate, absolutely if the current maximal matching sequence length is met, or judiciously, if a sufficient length is met, and finally for the simple possibility that the data is more recent and may correlate better with the next input.\r\n" + 
		"Pseudocode\r\n" + 
		"\r\n" + 
		"The pseudocode is a reproduction of the LZ77 compression algorithm sliding window.\r\n" + 
		"\r\n" + 
		"while input is not empty do\r\n" + 
		"    prefix := longest prefix of input that begins in window\r\n" + 
		"    \r\n" + 
		"    if prefix exists then\r\n" + 
		"        i := distance to start of prefix\r\n" + 
		"        l := length of prefix\r\n" + 
		"        c := char following prefix in input\r\n" + 
		"    else\r\n" + 
		"        i := 0\r\n" + 
		"        l := 0\r\n" + 
		"        c := first char of input\r\n" + 
		"    end if\r\n" + 
		"    \r\n" + 
		"    output (i, l, c)\r\n" + 
		"    \r\n" + 
		"    s := pop l + 1 chars from front of input\r\n" + 
		"    discard l + 1 chars from front of window\r\n" + 
		"    append s to back of window\r\n" + 
		"repeat\r\n" + 
		"\r\n" + 
		"Implementations\r\n" + 
		"\r\n" + 
		"Even though all LZ77 algorithms work by definition on the same basic principle, they can vary widely in how they encode their compressed data to vary the numerical ranges of a length?ance pair, alter the number of bits consumed for a length?ance pair, and distinguish their length?ance pairs from literals (raw data encoded as itself, rather than as part of a length?ance pair). A few examples:\r\n" + 
		"\r\n" + 
		"    The algorithm illustrated in Lempel and Ziv's original 1977 article outputs all its data three values at a time: the length and distance of the longest match found in the buffer, and the literal that followed that match. If two successive characters in the input stream could be encoded only as literals, the length of the length?ance pair would be 0.\r\n" + 
		"    LZSS improves on LZ77 by using a 1-bit flag to indicate whether the next chunk of data is a literal or a length?ance pair, and using literals if a length?ance pair would be longer.\r\n" + 
		"    In the PalmDoc format, a length?ance pair is always encoded by a two-byte sequence. Of the 16 bits that make up these two bytes, 11 bits go to encoding the distance, 3 go to encoding the length, and the remaining two are used to make sure the decoder can identify the first byte as the beginning of such a two-byte sequence.\r\n" + 
		"    In the implementation used for many games by Electronic Arts,[7] the size in bytes of a length?ance pair can be specified inside the first byte of the length?ance pair itself; depending on whether the first byte begins with a 0, 10, 110, or 111 (when read in big-endian bit orientation), the length of the entire length?ance pair can be 1 to 4 bytes.\r\n" + 
		"    As of 2008, the most popular LZ77-based compression method is DEFLATE; it combines LZSS with Huffman coding.[8] Literals, lengths, and a symbol to indicate the end of the current block of data are all placed together into one alphabet. Distances can be safely placed into a separate alphabet; because a distance only occurs just after a length, it cannot be mistaken for another kind of symbol or vice versa.\r\n" + 
		"\r\n" + 
		"LZ78\r\n" + 
		"\r\n" + 
		"LZ78 algorithms achieve compression by replacing repeated occurrences of data with references to a dictionary that is built based on the input data stream. Each dictionary entry is of the form dictionary[...] = {index, character}, where index is the index to a previous dictionary entry, and character is appended to the string represented by dictionary[index]. For example, \"abc\" would be stored (in reverse order) as follows: dictionary[k] = {j, 'c'}, dictionary[j] = {i, 'b'}, dictionary[i] = {0, 'a'}, where an index of 0 specifies the first character of a string. The algorithm initializes last matching index = 0 and next available index = 1. For each character of the input stream, the dictionary is searched for a match: {last matching index, character}. If a match is found, then last matching index is set to the index of the matching entry, and nothing is output. If a match is not found, then a new dictionary entry is created: dictionary[next available index] = {last matching index, character}, and the algorithm outputs last matching index, followed by character, then resets last matching index = 0 and increments next available index. Once the dictionary is full, no more entries are added. When the end of the input stream is reached, the algorithm outputs last matching index. Note that strings are stored in the dictionary in reverse order, which an LZ78 decoder will have to deal with.\r\n" + 
		"\r\n" + 
		"LZW is an LZ78-based algorithm that uses a dictionary pre-initialized with all possible characters (symbols) or emulation of a pre-initialized dictionary. The main improvement of LZW is that when a match is not found, the current input stream character is assumed to be the first character of an existing string in the dictionary (since the dictionary is initialized with all possible characters), so only the last matching index is output (which may be the pre-initialized dictionary index corresponding to the previous (or the initial) input character). Refer to the LZW article for implementation details.\r\n" + 
		"\r\n" + 
		"BTLZ is an LZ78-based algorithm that was developed for use in real-time communications systems (originally modems) and standardized by CCITT/ITU as V.42bis. When the trie-structured dictionary is full, a simple re-use/recovery algorithm is used to ensure that the dictionary can keep adapting to changing data. A counter cycles through the dictionary. When a new entry is needed, the counter steps through the dictionary until a leaf node is found (a node with no dependents). This is deleted and the space re-used for the new entry. This is simpler to implement than LRU or LFU and achieves equivalent performance.\r\n" + 
		"See also\r\n" + 
		"\r\n" + 
		"    Lempel?Stac (LZS)\r\n" + 
		"    Discrete cosine transform (DCT), a lossy compression algorithm used in JPEG and MPEG coding standards\r\n" + 
		"\r\n" + 
		"";
